【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 器具中心まで、しっかり明るい新配光技術<br />メーカー独自の配光技術マルチアングルシステムを更にブラッシュアップした『マルチアングルシステムII』により、カバー中心部から外周部まで配光させます。<br />天井面にも光が回り、部屋全体の明るさ感が向上しています。<br />LED光源は指向性が高いという特性があります。<br />マルチアングルシステムによりLEDの光を拡散させることで、部屋全体を照度ムラの無い空間にします。<br />また、天井面にも光があたりますので、部屋全体をより一層明るいイメージに替えます。<br /><br />★ 連続・多段調光機能<br />あかりの強弱の変更が可能です。連続調光と多段調光をあわせ持ったデジタル連調10で空間演出を楽しんでください。<br /><br />★ 使いやすいダイレクトリモコン<br />操作しやすさと持ちやすさに配慮したシンプルリモコン。<br />簡単設定おやすみタイマー<br />自動消灯がボタン1つで行えます。（30分・60分から選択できます。）<br />設定時間経過後は、“連続常夜球点灯”と“常夜球5分点灯ののち消灯”の2種類が選べます。<br /><br />★ 光源寿命 約40,000時間<br />LED光源は約40,000時間と長寿命なので、従来の蛍光ランプ器具のようなランプ交換のお手間を大幅に削減できます。<br />※製品の寿命を保証するものではありません。<br /><br />★ 簡単取付<br />ワンタッチで取付け・取外しOKの簡単取付機能採用器具です。<br />天井に引掛シーリングがついていれば、工具不要で押し上げるだけで取付けできます。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 光源情報：LED（昼光色　6700K　Ra85）<br />* モジュール寿命：40000時間（光束維持率：70％）<br />* 消費効率: 固有エネルギー消費効率　122.8lm/W（4299lm・35W）<br />* 調光<br />・連続調光（100％～約10％）<br />・多段調光（100％⇔約70％⇔約50％⇔約30％⇔約10％）、LED常夜灯、滅<br />* タイマー：スリープタイマー（30分・60分）<br />* 器具仕様<br />・乳白色アクリルグローブ<br />・外径480mm　高109mm　質量1.5kg<br />* 付属リモコン：RE0206<br />* その他機能<br />・フェードオフ機能付<br />・LED常夜灯<br />・お好みメモリー<br />・壁スイッチコントロール<br /><br />※LEDの寿命は40000時間（光束維持率70％）ですが、製品の寿命を保証するものではありません。<br />※ご使用前に必ず取扱説明書をお読み下さい。</p></div><!-- 商品仕様 ここまで --><style>

